        "# ============================================\n",
        "# ASSIGNMENT 5: K-MEANS CLUSTERING\n",
        "# ============================================\n",
        "print(\"\\n\" + \"=\"*80)\n",
        "print(\"ASSIGNMENT 5: K-MEANS CLUSTERING - TRAFFIC PATTERN SEGMENTATION\")\n",
        "print(\"=\"*80)\n",
        "\n",
        "from sklearn.cluster import KMeans\n",
        "from sklearn.preprocessing import StandardScaler\n",
        "from sklearn.metrics import silhouette_score, davies_bouldin_score\n",
        "\n",
        "# ============================================\n",
        "# STEP 1: PREPARE DATA FOR CLUSTERING\n",
        "# ============================================\n",
        "print(\"\\nüìä STEP 1: Preparing Data for K-Means Clustering...\")\n",
        "\n",
        "# Select features for clustering (normalized numerical features)\n",
        "clustering_features = ['temp_standard', 'rain_1h_standard', 'snow_1h_standard',\n",
        "                       'clouds_all_standard', 'hour', 'is_peak_hour', 'is_weekend',\n",
        "                       'congestion_index']\n",
        "\n",
        "X_clustering = df[clustering_features].copy()\n",
        "\n",
        "# Handle any remaining NaN values\n",
        "X_clustering = X_clustering.fillna(X_clustering.mean())\n",
        "\n",
        "print(f\"‚úÖ Features selected: {len(clustering_features)}\")\n",
        "print(f\"‚úÖ Samples: {X_clustering.shape[0]}\")\n",
        "print(f\"‚úÖ Features: {X_clustering.shape[1]}\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 2: DETERMINE OPTIMAL NUMBER OF CLUSTERS\n",
        "# ============================================\n",
        "print(\"\\nüîç STEP 2: Finding Optimal Number of Clusters (Elbow Method & Silhouette)...\")\n",
        "\n",
        "inertias = []\n",
        "silhouette_scores = []\n",
        "K_range = range(2, 11)\n",
        "\n",
        "for k in K_range:\n",
        "    kmeans = KMeans(n_clusters=k, random_state=42, n_init=10)\n",
        "    kmeans.fit(X_clustering)\n",
        "    inertias.append(kmeans.inertia_)\n",
        "    silhouette_scores.append(silhouette_score(X_clustering, kmeans.labels_))\n",
        "    print(f\"   K={k}: Inertia={kmeans.inertia_:.2f}, Silhouette={silhouette_scores[-1]:.3f}\")\n",
        "\n",
        "# Plot elbow curve and silhouette scores\n",
        "fig, axes = plt.subplots(1, 2, figsize=(14, 5))\n",
        "\n",
        "# Elbow curve\n",
        "axes[0].plot(K_range, inertias, marker='o', linewidth=2, markersize=8, color='#2E86AB')\n",
        "axes[0].set_xlabel('Number of Clusters (K)', fontsize=12)\n",
        "axes[0].set_ylabel('Inertia (Within-Cluster Sum of Squares)', fontsize=12)\n",
        "axes[0].set_title('Elbow Method - Optimal K Selection', fontsize=13, fontweight='bold')\n",
        "axes[0].grid(alpha=0.3)\n",
        "axes[0].set_xticks(K_range)\n",
        "\n",
        "# Silhouette scores\n",
        "axes[1].plot(K_range, silhouette_scores, marker='s', linewidth=2, markersize=8, color='#E74C3C')\n",
        "axes[1].set_xlabel('Number of Clusters (K)', fontsize=12)\n",
        "axes[1].set_ylabel('Silhouette Score', fontsize=12)\n",
        "axes[1].set_title('Silhouette Score - Cluster Quality', fontsize=13, fontweight='bold')\n",
        "axes[1].grid(alpha=0.3)\n",
        "axes[1].set_xticks(K_range)\n",
        "\n",
        "plt.tight_layout()\n",
        "plt.show()\n",
        "print(\"\\n‚úÖ Displayed: Elbow Curve & Silhouette Analysis\")\n",
        "\n",
        "# Select optimal K (usually where elbow occurs or max silhouette)\n",
        "optimal_k = 4  # Traffic: Free-flowing, Moderate, Congested, Gridlocked\n",
        "print(f\"\\nüéØ Selected optimal clusters: K={optimal_k}\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 3: APPLY K-MEANS WITH OPTIMAL K\n",
        "# ============================================\n",
        "print(f\"\\nüîß STEP 3: Applying K-Means Clustering with K={optimal_k}...\")\n",
        "\n",
        "kmeans_final = KMeans(n_clusters=optimal_k, random_state=42, n_init=10)\n",
        "df['traffic_cluster'] = kmeans_final.fit_predict(X_clustering)\n",
        "\n",
        "print(f\"‚úÖ K-Means model trained successfully\")\n",
        "print(f\"\\nüìä Cluster Distribution:\")\n",
        "print(df['traffic_cluster'].value_counts().sort_index())\n",
        "\n",
        "# ============================================\n",
        "# STEP 4: ANALYZE CLUSTERS\n",
        "# ============================================\n",
        "print(\"\\nüìà STEP 4: Analyzing Cluster Characteristics...\")\n",
        "\n",
        "# Get cluster centers\n",
        "cluster_centers = kmeans_final.cluster_centers_\n",
        "print(f\"\\n‚úÖ Cluster Centers:\")\n",
        "centers_df = pd.DataFrame(cluster_centers,\n",
        "                         columns=clustering_features)\n",
        "print(centers_df)\n",
        "\n",
        "# Analyze clusters by traffic characteristics\n",
        "cluster_analysis = df.groupby('traffic_cluster').agg({\n",
        "    'traffic_volume': ['mean', 'std', 'min', 'max'],\n",
        "    'temp': 'mean',\n",
        "    'rain_1h': 'mean',\n",
        "    'hour': 'mean',\n",
        "    'is_peak_hour': 'mean',\n",
        "    'is_weekend': 'mean',\n",
        "    'congestion_index': 'mean'\n",
        "}).round(2)\n",
        "\n",
        "print(f\"\\n‚úÖ Detailed Cluster Analysis:\")\n",
        "print(cluster_analysis)\n",
        "\n",
        "# ============================================\n",
        "# STEP 5: ASSIGN CLUSTER LABELS\n",
        "# ============================================\n",
        "print(\"\\nüè∑Ô∏è STEP 5: Assigning Descriptive Cluster Labels...\")\n",
        "\n",
        "# Map clusters to traffic conditions based on congestion_index\n",
        "cluster_traffic_levels = df.groupby('traffic_cluster')['congestion_index'].mean().sort_values()\n",
        "cluster_labels = {\n",
        "    cluster_traffic_levels.index[0]: 'Free-Flowing',\n",
        "    cluster_traffic_levels.index[1]: 'Moderate',\n",
        "    cluster_traffic_levels.index[2]: 'Congested',\n",
        "    cluster_traffic_levels.index[3]: 'Gridlocked'\n",
        "}\n",
        "\n",
        "df['traffic_cluster_label'] = df['traffic_cluster'].map(cluster_labels)\n",
        "\n",
        "print(f\"\\n‚úÖ Cluster Labels Assigned:\")\n",
        "for cluster_id, label in cluster_labels.items():\n",
        "    count = (df['traffic_cluster'] == cluster_id).sum()\n",
        "    pct = (count / len(df)) * 100\n",
        "    print(f\"   Cluster {cluster_id}: '{label}' ({count:,} records, {pct:.1f}%)\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 6: VISUALIZE CLUSTERS\n",
        "# ============================================\n",
        "print(\"\\nüìä STEP 6: Visualizing Clusters...\")\n",
        "\n",
        "fig, axes = plt.subplots(2, 2, figsize=(15, 12))\n",
        "\n",
        "# Cluster 1: Traffic volume vs Hour\n",
        "scatter1 = axes[0, 0].scatter(df['hour'], df['traffic_volume'],\n",
        "                             c=df['traffic_cluster'], cmap='viridis',\n",
        "                             alpha=0.5, s=30, edgecolors='black', linewidth=0.5)\n",
        "axes[0, 0].set_xlabel('Hour of Day', fontsize=11)\n",
        "axes[0, 0].set_ylabel('Traffic Volume', fontsize=11)\n",
        "axes[0, 0].set_title('Clusters: Traffic Volume vs Hour', fontsize=12, fontweight='bold')\n",
        "cbar1 = plt.colorbar(scatter1, ax=axes[0, 0])\n",
        "cbar1.set_label('Cluster')\n",
        "axes[0, 0].grid(alpha=0.3)\n",
        "\n",
        "# Cluster 2: Temperature vs Congestion Index\n",
        "scatter2 = axes[0, 1].scatter(df['temp'], df['congestion_index'],\n",
        "                             c=df['traffic_cluster'], cmap='viridis',\n",
        "                             alpha=0.5, s=30, edgecolors='black', linewidth=0.5)\n",
        "axes[0, 1].set_xlabel('Temperature (K)', fontsize=11)\n",
        "axes[0, 1].set_ylabel('Congestion Index', fontsize=11)\n",
        "axes[0, 1].set_title('Clusters: Temperature vs Congestion', fontsize=12, fontweight='bold')\n",
        "cbar2 = plt.colorbar(scatter2, ax=axes[0, 1])\n",
        "cbar2.set_label('Cluster')\n",
        "axes[0, 1].grid(alpha=0.3)\n",
        "\n",
        "# Cluster 3: Box plot by cluster\n",
        "df.boxplot(column='traffic_volume', by='traffic_cluster_label', ax=axes[1, 0])\n",
        "axes[1, 0].set_xlabel('Traffic Cluster', fontsize=11)\n",
        "axes[1, 0].set_ylabel('Traffic Volume', fontsize=11)\n",
        "axes[1, 0].set_title('Traffic Volume Distribution by Cluster', fontsize=12, fontweight='bold')\n",
        "axes[1, 0].grid(alpha=0.3, axis='y')\n",
        "plt.sca(axes[1, 0])\n",
        "plt.xticks(rotation=45, ha='right')\n",
        "\n",
        "# Cluster 4: Cluster count bar chart\n",
        "cluster_counts = df['traffic_cluster_label'].value_counts()\n",
        "colors_cluster = ['#FF6B6B', '#FFA06B', '#FFD93D', '#6BCB77']\n",
        "axes[1, 1].bar(range(len(cluster_counts)), cluster_counts.values,\n",
        "              color=colors_cluster, alpha=0.7, edgecolor='black', linewidth=1.5)\n",
        "axes[1, 1].set_xticks(range(len(cluster_counts)))\n",
        "axes[1, 1].set_xticklabels(cluster_counts.index, rotation=45, ha='right')\n",
        "axes[1, 1].set_ylabel('Number of Records', fontsize=11)\n",
        "axes[1, 1].set_title('Cluster Distribution', fontsize=12, fontweight='bold')\n",
        "axes[1, 1].grid(alpha=0.3, axis='y')\n",
        "\n",
        "# Add count labels on bars\n",
        "for i, v in enumerate(cluster_counts.values):\n",
        "    axes[1, 1].text(i, v + 500, str(v), ha='center', fontweight='bold')\n",
        "\n",
        "plt.suptitle('')  # Remove automatic title\n",
        "plt.tight_layout()\n",
        "plt.show()\n",
        "print(\"‚úÖ Displayed: Cluster Visualizations\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 7: CLUSTER CHARACTERISTICS BY TIME\n",
        "# ============================================\n",
        "print(\"\\n‚è∞ STEP 7: Cluster Patterns by Time...\")\n",
        "\n",
        "fig, axes = plt.subplots(1, 2, figsize=(15, 5))\n",
        "\n",
        "# Cluster distribution by hour\n",
