        "\n",
        "from mlxtend.frequent_patterns import apriori, association_rules\n",
        "from mlxtend.preprocessing import TransactionEncoder\n",
        "import pandas as pd\n",
        "import numpy as np\n",
        "\n",
        "# ============================================\n",
        "# STEP 1: PREPARE BINARY DATA FOR APRIORI\n",
        "# ============================================\n",
        "print(\"\\nüìä STEP 1: Preparing Binary Data for Apriori Algorithm...\")\n",
        "\n",
        "# Create binary features for association mining\n",
        "# Discretize continuous variables into categorical\n",
        "df_transactions = pd.DataFrame()\n",
        "\n",
        "# Weather conditions (binary)\n",
        "df_transactions['Rain'] = (df['rain_1h'] > 0).astype(int)\n",
        "df_transactions['Snow'] = (df['snow_1h'] > 0).astype(int)\n",
        "df_transactions['Cold'] = (df['temp'] < df['temp'].quantile(0.33)).astype(int)\n",
        "df_transactions['Hot'] = (df['temp'] > df['temp'].quantile(0.67)).astype(int)\n",
        "df_transactions['Cloudy'] = (df['clouds_all'] > 50).astype(int)\n",
        "\n",
        "# Traffic conditions (binary)\n",
        "df_transactions['High_Traffic'] = (df['traffic_level'] == 'High').astype(int)\n",
        "df_transactions['Medium_Traffic'] = (df['traffic_level'] == 'Medium').astype(int)\n",
        "df_transactions['Low_Traffic'] = (df['traffic_level'] == 'Low').astype(int)\n",
        "\n",
        "# Temporal conditions (binary)\n",
        "df_transactions['Peak_Hour'] = df['is_peak_hour'].astype(int)\n",
        "df_transactions['Off_Peak'] = (1 - df['is_peak_hour']).astype(int)\n",
        "df_transactions['Weekend'] = df['is_weekend'].astype(int)\n",
        "df_transactions['Weekday'] = (1 - df['is_weekend']).astype(int)\n",
        "df_transactions['Holiday'] = df['is_holiday'].astype(int)\n",
        "df_transactions['Regular_Day'] = (1 - df['is_holiday']).astype(int)\n",
        "\n",
        "# Morning/Evening peaks\n",
        "df_transactions['Morning_Rush'] = df['hour'].isin([7, 8, 9]).astype(int)\n",
        "df_transactions['Evening_Rush'] = df['hour'].isin([17, 18, 19]).astype(int)\n",
        "df_transactions['Night'] = df['hour'].isin([22, 23, 0, 1, 2, 3, 4, 5]).astype(int)\n",
        "df_transactions['Afternoon'] = df['hour'].isin([12, 13, 14, 15, 16]).astype(int)\n",
        "\n",
        "print(f\"‚úÖ Binary features created: {df_transactions.shape[1]}\")\n",
        "print(f\"‚úÖ Total transactions: {df_transactions.shape[0]}\")\n",
        "print(f\"\\nüìã Feature Summary:\")\n",
        "for col in df_transactions.columns[:10]:\n",
        "    count = df_transactions[col].sum()\n",
        "    pct = (count / len(df_transactions)) * 100\n",
        "    print(f\"   {col}: {count:,} occurrences ({pct:.1f}%)\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 2: APPLY APRIORI ALGORITHM\n",
        "# ============================================\n",
        "print(\"\\nüîç STEP 2: Applying Apriori Algorithm...\")\n",
        "\n",
        "# Different support thresholds to explore\n",
        "support_levels = [0.05, 0.1, 0.15]\n",
        "print(f\"\\n‚úÖ Testing support levels: {support_levels}\")\n",
        "\n",
        "for support in support_levels:\n",
        "    frequent_itemsets = apriori(df_transactions, min_support=support, use_colnames=True)\n",
        "    print(f\"   Support={support}: {len(frequent_itemsets)} frequent itemsets found\")\n",
        "\n",
        "# Use optimal support level\n",
        "optimal_support = 0.1\n",
        "frequent_itemsets = apriori(df_transactions, min_support=optimal_support, use_colnames=True)\n",
        "\n",
        "print(f\"\\n‚úÖ Using optimal support: {optimal_support}\")\n",
        "print(f\"‚úÖ Total frequent itemsets: {len(frequent_itemsets)}\")\n",
        "print(f\"\\nüìä Frequent Itemsets Summary:\")\n",
        "frequent_itemsets['Length'] = frequent_itemsets['itemsets'].apply(lambda x: len(x))\n",
        "print(frequent_itemsets['Length'].value_counts().sort_index())\n",
        "\n",
        "# ============================================\n",
        "# STEP 3: GENERATE ASSOCIATION RULES\n",
        "# ============================================\n",
        "print(\"\\nüìã STEP 3: Generating Association Rules...\")\n",
        "\n",
        "# Generate rules with different thresholds\n",
        "confidence_levels = [0.6, 0.7, 0.8]\n",
        "print(f\"\\n‚úÖ Testing confidence levels: {confidence_levels}\")\n",
        "\n",
        "for confidence in confidence_levels:\n",
        "    rules = association_rules(frequent_itemsets, metric=\"confidence\", min_threshold=confidence)\n",
        "    print(f\"   Confidence‚â•{confidence}: {len(rules)} rules generated\")\n",
        "\n",
        "# Use optimal confidence threshold\n",
        "optimal_confidence = 0.6\n",
        "rules = association_rules(frequent_itemsets, metric=\"confidence\", min_threshold=optimal_confidence)\n",
        "\n",
        "print(f\"\\n‚úÖ Using optimal confidence: {optimal_confidence}\")\n",
        "print(f\"‚úÖ Total association rules: {len(rules)}\")\n",
        "\n",
        "# Add additional metrics\n",
        "rules['antecedent_len'] = rules['antecedents'].apply(lambda x: len(x))\n",
        "rules['consequent_len'] = rules['consequents'].apply(lambda x: len(x))\n",
        "\n",
        "# ============================================\n",
        "# STEP 4: CALCULATE ADDITIONAL METRICS\n",
        "# ============================================\n",
        "print(\"\\nüìä STEP 4: Calculating Additional Metrics...\")\n",
        "\n",
        "# Leverage (how much more likely A and B occur together than separately)\n",
        "rules['leverage'] = rules['support'] - (rules['antecedent support'] * rules['consequent support'])\n",
        "\n",
        "# Conviction (how dependent consequent is on antecedent)\n",
        "rules['conviction'] = (1 - rules['consequent support']) / (1 - rules['confidence'])\n",
        "rules['conviction'] = rules['conviction'].replace([np.inf, -np.inf], np.nan)\n",
        "\n",
        "print(f\"‚úÖ Metrics calculated:\")\n",
        "print(f\"   Support: Prior probability of itemset\")\n",
        "print(f\"   Confidence: P(consequent | antecedent)\")\n",
        "print(f\"   Lift: How much more likely than random\")\n",
        "print(f\"   Leverage: Deviation from independence\")\n",
        "print(f\"   Conviction: Dependence strength\")\n",
        "\n",
        "# ============================================\n",
