        "print(\"\\nüöó STEP 6: Traffic-Specific Rules (What causes congestion?)...\")\n",
        "\n",
        "# Rules where consequent is High_Traffic\n",
        "traffic_rules = rules[rules['consequents'].apply(lambda x: 'High_Traffic' in x)].copy()\n",
        "traffic_rules = traffic_rules.sort_values('lift', ascending=False)\n",
        "\n",
        "print(f\"\\n‚úÖ Rules predicting High Traffic: {len(traffic_rules)}\")\n",
        "print(f\"\\n{'#':<3} {'If (Antecedent)':<40} {'Then HIGH TRAFFIC':<20} {'Conf':<8} {'Lift':<8}\")\n",
        "print(\"-\" * 80)\n",
        "\n",
        "for idx, (i, row) in enumerate(traffic_rules.head(10).iterrows(), 1):\n",
