        "from sklearn.neighbors import KNeighborsClassifier\n",
        "from sklearn.cluster import KMeans\n",
        "from sklearn.model_selection import train_test_split, cross_val_score\n",
        "from sklearn.metrics import accuracy_score, precision_score, recall_score, f1_score, confusion_matrix, classification_report\n",
        "\n",
        "# Visualization imports\n",
        "import matplotlib.pyplot as plt\n",
        "import seaborn as sns\n",
        "\n",
        "print(\"\\n\" + \"=\"*80)\n",
        "print(\"SMART CITY TRAFFIC MANAGEMENT - MODEL TRAINING PIPELINE (CORRECTED)\")\n",
        "print(\"=\"*80)\n",
        "\n",
        "# ============================================\n",
        "# STEP 1: LOAD AND PREPROCESS DATA\n",
        "# ============================================\n",
        "print(\"\\nüìä STEP 1: Loading and Preprocessing Data...\")\n",
        "\n",
        "try:\n",
        "    # Try to load from UCI ML Repository\n",
        "    from ucimlrepo import fetch_ucirepo\n",
        "    print(\"   Loading from UCI ML Repository...\")\n",
        "    traffic_data = fetch_ucirepo(id=492)\n",
        "    df = pd.concat([traffic_data.data.features, traffic_data.data.targets], axis=1)\n",
        "except:\n",
        "    # Fallback to local CSV\n",
        "    print(\"   Loading from local CSV...\")\n",
        "    df = pd.read_csv('Metro_Interstate_Traffic_Volume.csv')\n",
        "\n",
        "print(f\"   ‚úÖ Dataset loaded: {df.shape[0]} rows, {df.shape[1]} columns\")\n",
        "\n",
        "# Handle missing values\n",
        "df['holiday'] = df['holiday'].fillna('None')\n",
        "df['rain_1h'] = df['rain_1h'].fillna(0)\n",
        "df['snow_1h'] = df['snow_1h'].fillna(0)\n",
        "\n",
        "print(\"   ‚úÖ Missing values handled\")\n",
        "\n",
        "# Convert datetime\n",
        "df['date_time'] = pd.to_datetime(df['date_time'])\n",
        "\n",
        "# ============================================\n",
        "# STEP 2: FEATURE ENGINEERING\n",
        "# ============================================\n",
        "print(\"\\n‚öôÔ∏è STEP 2: Feature Engineering...\")\n",
        "\n",
        "# Extract temporal features\n",
        "df['year'] = df['date_time'].dt.year\n",
        "df['month'] = df['date_time'].dt.month\n",
        "df['day'] = df['date_time'].dt.day\n",
        "df['hour'] = df['date_time'].dt.hour\n",
        "df['day_of_week'] = df['date_time'].dt.dayofweek\n",
        "df['day_name'] = df['date_time'].dt.day_name()\n",
        "\n",
        "# Time-based indicators\n",
        "df['is_weekend'] = (df['day_of_week'] >= 5).astype(int)\n",
        "df['is_holiday'] = (df['holiday'] != 'None').astype(int)\n",
        "df['is_peak_hour'] = df['hour'].isin([7, 8, 9, 17, 18, 19]).astype(int)\n",
        "\n",
        "# Time periods\n",
        "def get_time_period(hour):\n",
        "    if hour < 6:\n",
        "        return 'Night'\n",
        "    elif hour < 12:\n",
        "        return 'Morning'\n",
        "    elif hour < 18:\n",
        "        return 'Afternoon'\n",
        "    else:\n",
        "        return 'Evening'\n",
        "\n",
        "df['time_period'] = df['hour'].apply(get_time_period)\n",
        "\n",
        "# Weather indicators\n",
        "df['is_rain'] = (df['rain_1h'] > 0).astype(int)\n",
        "df['is_snow'] = (df['snow_1h'] > 0).astype(int)\n",
        "df['is_cold'] = (df['temp'] < df['temp'].quantile(0.33)).astype(int)\n",
        "df['is_cloudy'] = (df['clouds_all'] > 50).astype(int)\n",
        "\n",
        "# ============================================\n",
        "# STEP 3: CALCULATE DYNAMIC CONGESTION INDEX\n",
        "# ============================================\n",
        "print(\"\\nüìä STEP 3: Calculating Dynamic Congestion Index...\")\n",
        "\n",
        "def calculate_congestion_index(row):\n",
        "    \"\"\"\n",
        "    Calculate dynamic congestion index based on multiple factors\n",
        "    Range: 0.0 (free-flowing) to 1.0 (gridlocked)\n",
        "    \"\"\"\n",
        "\n",
        "    base_congestion = 0.3\n",
        "\n",
        "    # Peak hour factor (7-9 AM, 5-7 PM) - increases congestion\n",
        "    if row['is_peak_hour'] == 1:\n",
        "        base_congestion += 0.35\n",
        "\n",
        "    # Rain factor - increases congestion\n",
        "    if row['rain_1h'] > 0:\n",
        "        rain_impact = min(row['rain_1h'] * 0.03, 0.20)  # Max 20%\n",
        "        base_congestion += rain_impact\n",
        "\n",
        "    # Snow factor - increases congestion significantly\n",
        "    if row['snow_1h'] > 0:\n",
        "        snow_impact = min(row['snow_1h'] * 0.05, 0.25)  # Max 25%\n",
        "        base_congestion += snow_impact\n",
        "\n",
        "    # Cloud cover factor - slight impact\n",
        "    if row['clouds_all'] > 75:\n",
        "        base_congestion += 0.05\n",
        "\n",
        "    # Weekend factor - decreases congestion\n",
        "    if row['is_weekend'] == 1:\n",
        "        base_congestion -= 0.15\n",
        "\n",
        "    # Holiday factor - decreases congestion\n",
        "    if row['is_holiday'] == 1:\n",
        "        base_congestion -= 0.10\n",
        "\n",
        "    # Temperature extremes - slight increase\n",
        "    temp_celsius = row['temp'] - 273.15\n",
        "    if temp_celsius < -5 or temp_celsius > 35:\n",
        "        base_congestion += 0.08\n",
        "\n",
        "    # Hour factor (night hours reduce congestion)\n",
        "    if row['hour'] >= 22 or row['hour'] <= 5:\n",
        "        base_congestion -= 0.20\n",
        "\n",
        "    # Clamp between 0.0 and 1.0\n",
        "    congestion_index = max(0.0, min(1.0, base_congestion))\n",
        "\n",
        "    return congestion_index\n",
        "\n",
        "df['congestion_index'] = df.apply(calculate_congestion_index, axis=1)\n",
        "\n",
        "print(f\"   ‚úÖ Congestion index calculated\")\n",
        "print(f\"   Mean congestion: {df['congestion_index'].mean():.3f}\")\n",
        "print(f\"   Range: {df['congestion_index'].min():.3f} to {df['congestion_index'].max():.3f}\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 4: TRAFFIC LEVEL CATEGORIES (TARGET)\n",
        "# ============================================\n",
        "print(\"\\nüéØ STEP 4: Creating Traffic Level Categories...\")\n",
        "\n",
        "# Traffic level categories based on actual volume\n",
        "traffic_percentiles = df['traffic_volume'].quantile([0.33, 0.67])\n",
        "\n",
        "def categorize_traffic(volume):\n",
        "    if volume <= traffic_percentiles[0.33]:\n",
        "        return 'Low'\n",
        "    elif volume <= traffic_percentiles[0.67]:\n",
        "        return 'Medium'\n",
        "    else:\n",
        "        return 'High'\n",
        "\n",
        "df['traffic_level'] = df['traffic_volume'].apply(categorize_traffic)\n",
        "\n",
        "print(f\"‚úÖ Traffic Level Distribution:\")\n",
        "print(df['traffic_level'].value_counts())\n",
        "\n",
        "# ============================================\n",
        "# STEP 5: PREPARE FEATURES FOR MODELING\n",
        "# ============================================\n",
        "print(\"\\nüìã STEP 5: Preparing Features for Modeling...\")\n",
        "\n",
        "# Select features for KNN model\n",
        "feature_names = [\n",
        "    'temp', 'rain_1h', 'snow_1h', 'clouds_all',\n",
        "    'hour', 'day_of_week', 'is_peak_hour',\n",
        "    'is_weekend', 'is_holiday', 'congestion_index'\n",
        "]\n",
        "\n",
        "X = df[feature_names].copy()\n",
        "y = df['traffic_level'].copy()\n",
        "\n",
        "# Handle NaN\n",
        "X = X.fillna(X.mean())\n",
        "\n",
        "print(f\"   ‚úÖ Features: {len(feature_names)}\")\n",
        "print(f\"   Features: {feature_names}\")\n",
        "\n",
        "# Standardize numerical features\n",
        "scaler = StandardScaler()\n",
        "cols_to_scale = ['temp', 'rain_1h', 'snow_1h', 'clouds_all']\n",
        "\n",
        "X_scaled = X.copy()\n",
        "X_scaled[cols_to_scale] = scaler.fit_transform(X[cols_to_scale])\n",
        "\n",
        "print(f\"   ‚úÖ Features standardized\")\n",
        "print(f\"   Target classes: {y.unique()}\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 6: TRAIN-TEST SPLIT\n",
        "# ============================================\n",
        "print(\"\\nüîÄ STEP 6: Train-Test Split...\")\n",
        "\n",
        "X_train, X_test, y_train, y_test = train_test_split(\n",
        "    X_scaled, y, test_size=0.2, random_state=42, stratify=y\n",
        ")\n",
        "\n",
        "print(f\"   ‚úÖ Training set: {X_train.shape[0]} records (80%)\")\n",
        "print(f\"   ‚úÖ Test set: {X_test.shape[0]} records (20%)\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 7: FIND OPTIMAL K FOR KNN\n",
        "# ============================================\n",
        "print(\"\\nüîç STEP 7: Finding Optimal K Value...\")\n",
        "\n",
        "k_values = range(3, 21)\n",
        "train_scores = []\n",
        "cv_scores = []\n",
        "gaps = []\n",
        "\n",
        "for k in k_values:\n",
        "    knn = KNeighborsClassifier(n_neighbors=k, weights='uniform', metric='euclidean')\n",
        "    knn.fit(X_train, y_train)\n",
        "\n",
        "    train_score = knn.score(X_train, y_train)\n",
        "    train_scores.append(train_score)\n",
        "\n",
        "    cv_score = cross_val_score(knn, X_train, y_train, cv=5, scoring='accuracy').mean()\n",
        "    cv_scores.append(cv_score)\n",
        "\n",
        "    gap = train_score - cv_score\n",
        "    gaps.append(gap)\n",
        "\n",
        "    if k % 5 == 3 or k == 3:\n",
        "        print(f\"   K={k:2d}: Train={train_score:.4f}, CV={cv_score:.4f}, Gap={gap:.4f}\")\n",
        "\n",
        "# Select best K (minimize overfitting gap)\n",
        "best_gap_idx = np.argmin(gaps)\n",
        "best_gap_k = list(k_values)[best_gap_idx]\n",
        "best_gap_score = cv_scores[best_gap_idx]\n",
        "best_gap_value = min(gaps)\n",
        "\n",
        "print(f\"\\n   üéØ Selected K: {best_gap_k}\")\n",
        "print(f\"      CV Accuracy: {best_gap_score:.4f}\")\n",
        "print(f\"      Overfitting Gap: {best_gap_value:.4f}\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 8: TRAIN KNN MODEL\n",
        "# ============================================\n",
        "print(f\"\\nüîß STEP 8: Training KNN Model (K={best_gap_k})...\")\n",
        "\n",
        "knn_model = KNeighborsClassifier(\n",
        "    n_neighbors=best_gap_k,\n",
        "    weights='distance',\n",
        "    metric='euclidean'\n",
        ")\n",
        "knn_model.fit(X_train, y_train)\n",
        "\n",
        "# Evaluate\n",
        "train_accuracy = knn_model.score(X_train, y_train)\n",
        "test_accuracy = knn_model.score(X_test, y_test)\n",
        "y_pred = knn_model.predict(X_test)\n",
        "\n",
        "print(f\"   ‚úÖ Model trained successfully\")\n",
        "print(f\"   Training Accuracy: {train_accuracy:.4f} ({train_accuracy*100:.2f}%)\")\n",
        "print(f\"   Test Accuracy: {test_accuracy:.4f} ({test_accuracy*100:.2f}%)\")\n",
        "\n",
        "# Classification report\n",
        "print(f\"\\n   üìä Classification Report:\")\n",
        "print(classification_report(y_test, y_pred, digits=4))\n",
        "\n",
        "# ============================================\n",
        "# STEP 9: TRAIN K-MEANS MODEL\n",
        "# ============================================\n",
        "print(\"\\nüîß STEP 9: Training K-Means Clustering Model...\")\n",
        "\n",
        "kmeans_model = KMeans(n_clusters=4, random_state=42, n_init=10)\n",
        "kmeans_model.fit(X_scaled)\n",
        "\n",
        "print(f\"   ‚úÖ K-Means model trained successfully\")\n",
        "print(f\"   Clusters: 4\")\n",
        "print(f\"   Inertia: {kmeans_model.inertia_:.2f}\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 10: SAVE MODELS AND CONFIGURATION\n",
        "# ============================================\n",
        "print(\"\\nüíæ STEP 10: Saving Models and Configuration...\")\n",
        "\n",
        "# Save KNN model\n",
        "with open('traffic_predictor.pkl', 'wb') as f:\n",
        "    pickle.dump(knn_model, f)\n",
        "print(\"   ‚úÖ Saved: traffic_predictor.pkl\")\n",
        "\n",
        "# Save K-Means model\n",
        "with open('kmeans_model.pkl', 'wb') as f:\n",
        "    pickle.dump(kmeans_model, f)\n",
        "print(\"   ‚úÖ Saved: kmeans_model.pkl\")\n",
        "\n",
        "# Save scaler\n",
        "with open('scaler (3).pkl', 'wb') as f:\n",
        "    pickle.dump(scaler, f)\n",
        "print(\"   ‚úÖ Saved: scaler (3).pkl\")\n",
        "\n",
        "# Save configuration\n",
        "config = {\n",
        "    'feature_names': feature_names,\n",
        "    'n_clusters': 4,\n",
        "    'cluster_labels': {\n",
        "        '0': 'Free-Flowing',\n",
        "        '1': 'Moderate',\n",
        "        '2': 'Congested',\n",
        "        '3': 'Gridlocked'\n",
        "    },\n",
        "    'metrics': {\n",
        "        'optimal_k': int(best_gap_k),\n",
        "        'cv_score': float(best_gap_score),\n",
        "        'train_accuracy': float(train_accuracy),\n",
        "        'test_accuracy': float(test_accuracy),\n",
        "        'classes': knn_model.classes_.tolist()\n",
        "    },\n",
        "    'timestamp': datetime.now().isoformat()\n",
        "}\n",
        "\n",
        "with open('model_config.json', 'w') as f:\n",
        "    json.dump(config, f, indent=4)\n",
        "print(\"   ‚úÖ Saved: model_config.json\")\n",
        "\n",
        "# ============================================\n",
        "# STEP 11: TEST PREDICTION WITH DYNAMIC CONGESTION\n",
        "# ============================================\n",
        "print(\"\\nüß™ STEP 11: Testing Prediction System with Dynamic Congestion...\")\n",
        "\n",
        "def predict_traffic(temp, rain, snow, clouds, hour, day_of_week, is_holiday=0):\n",
        "    \"\"\"Make a prediction with dynamic congestion calculation\"\"\"\n",
        "\n",
        "    # Calculate derived features\n",
        "    is_peak_hour = 1 if hour in [7, 8, 9, 17, 18, 19] else 0\n",
        "    is_weekend = 1 if day_of_week >= 5 else 0\n",
        "\n",
        "    # CALCULATE DYNAMIC CONGESTION INDEX\n",
        "    base_congestion = 0.3\n",
        "\n",
        "    if is_peak_hour:\n",
        "        base_congestion += 0.35\n",
        "\n",
        "    if rain > 0:\n",
        "        base_congestion += min(rain * 0.03, 0.20)\n",
        "\n",
        "    if snow > 0:\n",
        "        base_congestion += min(snow * 0.05, 0.25)\n",
        "\n",
        "    if clouds > 75:\n",
        "        base_congestion += 0.05\n",
        "\n",
        "    if is_weekend:\n",
        "        base_congestion -= 0.15\n",
        "\n",
        "    if is_holiday:\n",
        "        base_congestion -= 0.10\n",
        "\n",
        "    temp_celsius = temp - 273.15\n",
        "    if temp_celsius < -5 or temp_celsius > 35:\n",
        "        base_congestion += 0.08\n",
        "\n",
        "    if hour >= 22 or hour <= 5:\n",
        "        base_congestion -= 0.20\n",
        "\n",
        "    congestion_index = max(0.0, min(1.0, base_congestion))\n",
        "\n",
        "    # Create feature array\n",
        "    features = np.array([\n",
        "        temp, rain, snow, clouds, hour, day_of_week,\n",
        "        is_peak_hour, is_weekend, is_holiday, congestion_index\n",
        "    ]).reshape(1, -1)\n",
        "\n",
        "    # Standardize\n",
        "    features_scaled = features.copy()\n",
        "    features_scaled[:, [0, 1, 2, 3]] = scaler.transform(features[:, [0, 1, 2, 3]])\n",
        "\n",
        "    # Predict\n",
        "    prediction = knn_model.predict(features_scaled)[0]\n",
        "    proba = knn_model.predict_proba(features_scaled)[0]\n",
        "    confidence = np.max(proba)\n",
        "\n",
        "    # Cluster\n",
        "    cluster = kmeans_model.predict(features_scaled)[0]\n",
        "\n",
        "    return prediction, confidence, cluster, congestion_index\n",
        "\n",
        "# Test cases with different scenarios\n",
        "test_cases = [\n",
        "    {\"name\": \"Morning Rush (Clear)\", \"temp\": 288, \"rain\": 0, \"snow\": 0, \"clouds\": 20, \"hour\": 8, \"day\": 1, \"holiday\": 0},\n",
        "    {\"name\": \"Evening Rush (Rainy)\", \"temp\": 285, \"rain\": 3.0, \"snow\": 0, \"clouds\": 90, \"hour\": 18, \"day\": 2, \"holiday\": 0},\n",
        "    {\"name\": \"Snowy Weekend\", \"temp\": 268, \"rain\": 0, \"snow\": 5.0, \"clouds\": 95, \"hour\": 14, \"day\": 6, \"holiday\": 0},\n",
        "    {\"name\": \"Night Time (Clear)\", \"temp\": 280, \"rain\": 0, \"snow\": 0, \"clouds\": 10, \"hour\": 2, \"day\": 3, \"holiday\": 0},\n",
        "    {\"name\": \"Holiday Afternoon\", \"temp\": 295, \"rain\": 0, \"snow\": 0, \"clouds\": 30, \"hour\": 15, \"day\": 5, \"holiday\": 1},\n",
        "]\n",
        "\n",
        "print(\"\\n   Test Predictions:\")\n",
        "print(f\"   {'Scenario':<25} {'Traffic':<12} {'Confidence':<12} {'Congestion':<12}\")\n",
        "print(\"   \" + \"-\" * 65)\n",
        "\n",
        "for test in test_cases:\n",
        "    pred, conf, cluster, cong = predict_traffic(\n",
